import React from "react";

class InterestComponent extends React.Component {
  render(): React.ReactNode {
    return (
      <div className="bg-white w-full h-40 mt-2 p-2">
        <div className="flex w-full p-2">
          <h2>관심종목</h2>
        </div>
        <div className="w-full pl-2 pr-2 pb-1 flex gap-1 flex-myFlex border-b-2">
          <span className="text-sm w-2/5">종목명</span>
          <span className="text-sm w-1/5 text-center">등락률</span>
          <span className="text-sm w-2/5 text-right">거래량 ・ 현재가 </span>
        </div>
        <ul className="ml-2 mr-2 pt-1">
          <li className="flex gap-1 mb-2">
            <div className="w-2/5 font-bold text-base">신성델타테크</div>
            <div className="w-1/5 font-bold">
                <div className="w-10 text-sm bg-blue-600 text-white text-center rounded-md max-w-xs p-2">-3.37%</div>
            </div>
            <div className="w-2/5 text-right">
              <div className="font-bold text-base text-blue-600">-1,471,745</div>
              <div className="text-sm font-bold">47,360</div>
            </div>
          </li>
        </ul>
      </div>
    );
  }
}

export default InterestComponent;
